TABLEATTRIBUTE.VALUE:
UPDATE IN_LIVECNT_RESULT lt
SET lt.dec_qtr_live            = 0
WHERE DTE_ROLLING_QTR_END_MTH IN
  (SELECT LAST_DAY(TO_DATE(CTL.txt_key_value, 'YYYY-MM-DD'))
  FROM IN_ETL_CONTROL CTL
  WHERE CTL.txt_key_string = 'OPER_CYCLE_DATE'
  AND ctl.txt_file_name    = 'GLOBAL'
  );
commit;
